import React, { useState } from 'react';
import './Sidebar.css';
import { SidebarDetails } from './SidebarDetails';
import IconButton from '@mui/material/IconButton';
import ChevronLeftIcon from '@mui/icons-material/ChevronLeft'; // Example icon

function Sidebar() {
  const [sidebarVisible, setSidebarVisible] = useState(true);

  const toggleSidebar = () => {
    setSidebarVisible(!sidebarVisible);
  };

  return (
    <div className="App">
      <div className={sidebarVisible ? 'sidebar' : 'sidebar hidden'}>
        <IconButton className="toggle-button" onClick={toggleSidebar}>
          <ChevronLeftIcon />
        </IconButton>
        <ul className='list'>
          {SidebarDetails.map((val, key) => {
            return (
              <li
                key={key}
                className='row'
                onClick={() => {
                  window.location.pathname = val.link;
                }}
              >
                <div>{val.icon}</div> <div>{val.title}</div>
              </li>
            );
          })}
        </ul>
      </div>
    </div>
  );
}

export default Sidebar;
